import React from "react";
import styled from 'styled-components';

const StyledHome = styled.div`
background-color: #000;
`;
const Home = props => {
  const onButtonClick = () => {
    props.history.push("/form");
  };
  const onButtonClickAbout = () => {
    props.history.push("/about");
  };

  return (
    <StyledHome>
      <h1>Hello World</h1>
      <button onClick={onButtonClick}>Pushing to Form</button>
      <button onClick={onButtonClickAbout}>Pushing to About</button>
    </StyledHome>
  );
};

export default Home;
